import React from 'react'
import styled from 'styled-components'

const Styles = styled.div`

    .container {
        width: 100%;
        height: 100%;
        background-color: #A9BCD0;
    }

    .content {
        position: relative;
        top: 0;
        left: 0;
        bottom:0;
        right:0;
      }
    
    .title {
        color: #007acc;
        font-family: Verdana, Arial, Helvetica, sans-serif;
        text-align: center;
        font-Size: 35px;
        letter-spacing: 3px;
    }
`;

const HomePage = () => {
    return (
        <div>
            <h4>HOME PAGE</h4>
        </div>
    )
}

export default HomePage;
